import React from 'react';
import { StringLiteral } from 'typescript';
import './App.css';
import jsonObject from './JSON/test.json'
import CDECard from './components/CDE';
import CounterDisplay from './components/CounterDisplay';
import CounterChanger from './components/CounterChanger';

// Defining our Todo class 
class Todo extends React.Component<{}, AppState> {
    userId!: number; 
    id!: number; 
    title!: string; 
    done!: boolean;
    label!: string;
    name1!: string;
    spec1!: string;

    constructor(props: any) {
        super(props);
        // Put your page name below for easier testing
        this.state = { currentPage: Screens.LandingPage, lessonId: 2, returningUser: false, anyCourses: true };
      }

    getLabel() { 
        return this.label; 
    }

    getName() {
        return this.name1;
    }

    getSpec() {
        return this.spec1;
    }

    isDone() { 
        return this.done; 
    } 

    private getCurrentScreen = (): JSX.Element => {
        switch (this.state.currentPage) {
          case Screens.LandingPage:
            if (this.state.returningUser && this.state.anyCourses) {
              return <HomePage lessonId={this.state.lessonId} changeLesson={this.changeLesson} changeScreen={this.changeScreen} />;
            }
            else if (!this.state.anyCourses) {
              return <AllCoursesPage changeScreen={this.changeScreen} />;
            }
            else {
              return <LandingPage changeScreen={this.changeScreen} />;
            }
          case Screens.HomePage:
            return <HomePage lessonId={this.state.lessonId} changeLesson={this.changeLesson} changeScreen={this.changeScreen} />;
          case Screens.AllCoursesPage:
            return <AllCoursesPage changeScreen={this.changeScreen} />;
          case Screens.LessonPage:
            return <Lesson lessonId={this.state.lessonId} changeScreen={this.changeScreen}></Lesson>;
          default:
            return <div>ERROR</div>;
        }
      };
} 

// Object.assign() will clone jsonData into 
// Todo class object Storing the new class 
// object in a typescript variable 
let newTodo = Object.assign(new Todo(), jsonObject); 

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Person Focused Set 2 (Marriage and Sex) Tier 2</h1>
        <div id="versions">
            <p className="version">1.0</p>
            <p className="version">2.0</p>
            <p className="version">3.0</p>
            <p className="version">4.0</p>
        </div>
        <br/>
        {createLabel2("Sexual Orientation", "Something")}


      </header>
    </div>
  );
}

function createLabel2(label: string, name: string) {
    return (
      <section className="labelCard"> 
            <h1>Label: {label}</h1>
            <div className="cards">
                <CDECard></CDECard>
                <CDECard></CDECard>
                <CDECard></CDECard>
            </div>
      </section>
    )
  }

  function createLabel3 (label: string, name: string) {
    return (
      <section className="labelCard"> 
          <h1>Label: {label}</h1>
          <div className="cards">
              <div className="CDECard">
                  <h2>CDE Name</h2>
                  {name}
                  <h2> Specification</h2>
                  <p>
                      1a. What terms best express how you describe your gender identity? (Check all that apply)
                  </p>
                  <p className="list">
                      Man<br />
                      Woman<br />
                      Non-binary<br />
                      Transgender<br />
                      None of these describe me, and I’d like to consider additional options<br />
                      Prefer not to answer<br />
                  </p>
                  <h2>Collection</h2>
                  <p>Self-Report</p>

                  <h2>Source</h2>
                  <p>RADx [All of Us Research Program PPI]</p>

                  <h2>Definition</h2>
                  <p>
                      NCIt and CDISC:  Gender Identity (Code C158277) – Definition:  A person's internally 
                      held sense of their gender, which may or may not correspond to the individual's genotypic or phenotypic sex.
                  </p>


              </div>



              <div className="CDECard">
                  <h2>CDE Specification: {name}</h2>
                  <p>
                      1b. Are any of these a closer description to your gender identity?
                  </p>

                  <p className="list">
                      Trans man/Transgender Man/FTM<br />
                      Trans woman/Transgender Woman/MTF <br />
                      Genderqueer<br />
                      Genderfluid<br />
                      Gender variant<br />
                      Questioning or unsure of your gender identity<br />
                  </p>
                  <h2>Collection</h2>
                  <p>Self-Report</p>

                  <h2>Source</h2>
                  <p>RADx [NIH SGMRO]</p>

                  <h2>Definition</h2>
                  <p>
                      NCIt and CDISC:  Gender Identity (Code C158277) – Definition:  A person's internally 
                      held sense of their gender, which may or may not correspond to the individual's genotypic or phenotypic sex.
                  </p>
              </div>
          </div>
          <section className="voteSection"> 
              <div className="voteCard">
                  <p>Vote</p>
              </div>
              <div className="voteCard">
                  <p>Vote</p>
              </div>
          </section>
      </section>
    )
  }

export default App;
